Operation Dumbo Drop (1995) (Eng)(NL sub)

Nederlands:
Tijdens de Vietnam-oorlog wilde het Amerikaanse leger olifanten gebruiken
als geheim wapen. In 1968 wordt een team van 5 soldaten uitgezonden om een
Ooifant te vangen en te transporteren door de jungle.

English:
To keep the loyalty of a native village during the Vietnam war, a US Army
officer and his unit struggle to deliver it a live elephant.


Met o.a.
Danny Glover, Ray Liotta en Denis Leary


